import Ispis from "./dashboard.js";

export default function CryptoData() {
    const btc = {
        imevalute: "btc",
        vrijednost: "33280$",
    };
    const eth = {
        imevalute: "eth",
        vrijednost: "3023$",
    };
    const dog = {
        imevalute: "dog",
        vrijednost: "0.001$",
    };
    const shib = {
        imevalute: "shib",
        vrijednost: "0.05$",
    };
    const sol = {
        imevalute: "sol",
        vrijednost: "136$",
    };
    const alg = {
        imevalute: "alg",
        vrijednost: "17$",
    };
    return (
      <div>
        <Ispis btc1={btc} eth1={eth} dog1={dog} shib1={shib} sol1={sol} alg1={alg} />
      </div>
    );
  }
